export enum ProjectStatus {
  Active,
  Finished,
  Overdue,
}

export interface Todo {
  id: string;
  text: string;
  status: ProjectStatus;
  priority: "p1" | "p2" | "p3" | "p4";
  date: string;
  createdOn: Date;
  fullDate: Date;
}
